import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './authentication/login/login.component';
import { RegisterComponent } from './authentication/register/register.component';
import { MarbledetailsComponent } from './product/marbledetails/marbledetails.component';
import { AppComponent } from './app.component';
import { DetailsComponent } from './product/details/details.component';
import { CartComponent } from './product/cart/cart.component';
import { CommonModule } from '@angular/common';
import { CheckoutComponent } from './product/checkout/checkout.component';
import { ConformationOfinquiryComponent } from './product/conformation-ofinquiry/conformation-ofinquiry.component';
import { DisplaycatComponent } from './admin/displaycat/displaycat.component';
import { CreatecatComponent } from './admin/createcat/createcat.component';
import { DisplayapplicationComponent } from './admin/displayapplication/displayapplication.component';
import { CreateapplicationComponent } from './admin/createapplication/createapplication.component';
import { DisplayProductlistComponent } from './admin/display-productlist/display-productlist.component';
import { CreateProductComponent } from './admin/create-product/create-product.component';
import { ManageInquiryComponent } from './admin/manage-inquiry/manage-inquiry.component';
import { UpdateInquirystatusComponent } from './admin/update-inquirystatus/update-inquirystatus.component';
import { DemoRoutingModule } from './demo/demo-routing.module';

const routes: Routes = [
  { path: 'demo', loadChildren: () => import('./demo/demo.module').then(m => m.DemoModule )},
  { path: 'Login', component: LoginComponent },
  { path: 'Register', component: RegisterComponent },
  { path: '', component: MarbledetailsComponent },
  { path: 'Home', component: AppComponent },
  { path: 'detail/:id', component: DetailsComponent },
  { path: 'cart', component: CartComponent },
  { path: 'checkout', component: CheckoutComponent },
  { path: 'conformation', component: ConformationOfinquiryComponent },
  { path: 'displaycat', component: DisplaycatComponent },
  { path: 'createcat/:id', component: CreatecatComponent },
  { path: 'displayapplication', component: DisplayapplicationComponent },
  { path: 'createapplication/:id', component: CreateapplicationComponent },
  { path: 'displayproductlist', component: DisplayProductlistComponent },
  { path: 'createproduct/:id', component: CreateProductComponent },
  { path: 'manage-inquiry', component: ManageInquiryComponent },
  { path: 'updateinquirystatus/:id', component: UpdateInquirystatusComponent }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
